import React from 'react';
import Login from './Login';
import useToken from './useToken';
import './App.css';

export default function Dash() {
  const {token, setToken} = useToken();

  if(!token) {
    return <Login setToken={setToken}/>
  }

  return (
    <div className="App">
      <header className="App-header">
      </header>
    </div>
  );
}
